import {WorksCardStyled, 
    WorksCardNumber} from "./WorksCard.styled"


export const WorksCard = ({number, header, text}) => {
    return (
        <WorksCardStyled>
         <WorksCardNumber>{number}</WorksCardNumber>
         <h4>{header}</h4>
         <p>{text}</p>
       </WorksCardStyled>
    );
  };
